import Vue from 'vue'
import Router from 'vue-router'

Vue.use(Router)

export default new Router({
  mode: 'history',
  routes: [
    {
      path: '/',
      name: 'AppIframe',
      component: import('./AppIframe.vue')
    },
    {
      path: '/redirect/',
      name: 'AppRefirect',
      component: import('./AppRedirect.vue')
    }
  ]
})
